import axios from 'axios';
import authHeader from './authorization';

const API_URL = 'http://localhost:8080/api/auth/';

class ProductService {
  addNewProduct(data) {
    return axios.get(API_URL + 'addproduct', data);
  }

  getAllProducts() {
    return axios.get(API_URL + 'getproducts');
  }

  getOneProduct(data) {
    return axios.get(API_URL + 'getproductbyid', data);
  }

  updateProduct(data) {
    return axios.get(API_URL + 'update', data);
  }

  deleteProduct(data) {
    return axios.get(API_URL + 'delete', data);
  }
}

export default new ProductService();
